	infoversioneng = {
		"1. Release",
		"1. New variables/functions have been added:\n[rpnickid(number)] - outputs rp nicknames (number id is the player's id, the variable will not be able to output your nickname).\n[lvl(number)] - outputs the lvl of the player (number is the id of the player, the variable will not be able to output your lvl).\n[removecolor(text)] - removes all values in the text by type {FFFFFF}.\n{my_lvl} - output your lvl.\n{my_rpnick} - displays your rp nickname.\n{my_armor} - displays your armor.\n{my_hp} - displays your health level.\n2. Flaws were fixed in the script:\n Some bugs are fixed.\nChanged the dependency from rkeys to vkeys.",
		"1. New variables have been added:\n{my_name} - outputs your name\n{my_surname} - outputs your surname\n[random(number)] - outputs a random number (number - up to what number)\n[nameid(number)] - outputs the player's name by his id (number - id)\n[surnameid(number)] - outputs the player's last name by his id (number - id)\n{my_fps} - outputs your fps\n[match(text,search)] - outputs the value you specified from the text (text is the text itself, search is the search template) - click\n2. A lot of bugs were fixed.",
		'1. New variables/functions have been added:\n{my_car_speed} - outputs the speed of your transport\n{my_car_model} - outputs the model of your transport\n{my_car_color1} - outputs the color #1 of your transport\n{my_car_color2} - outputs the color #2 of your transport\n{my_car_hp} - outputs the hp of your transport\n{my_car_X} - outputs the X coordinate of your transport\n{my_car_Y} - outputs the Y coordinate of your transport\n{my_car_Z} - outputs the Z coordinate of your transport\n{my_car_name_model} - outputs the name of your transport\n{my_car_id} - outputs the id of your transport\ndeletecar(number) - deletes the transport (number - id of the car)\nraulicstrue - activates hydraulics\nraulicsfalse - deactivates hydraulics\nkeypause(number) - pauses the bind, and activates it when a certain button is pressed\ncommandpause(text) - pauses the bind, and activates it when a certain command is entered (text - command, without "/")\n2. Were bugs have been fixed.',
		"1. New variables/functions have been added:\n{car_id_nearest} - outputs the id of the nearest car\n{car_driverid_nearest} - outputs the driver id of the nearest car\n{player_id_nearest} - outputs the id of the player closest to you\n{player_color_id_nearest} - outputs the id of the player closest to you if his nickname color is different from yours\n{player_id_target} - outputs the id of the player you are targeting\n[car_passenger_seat_playerid(idcar, passenger)] - outputs the id of the passenger (idcar - id car, passenger - seat number)\n[car_name_model(number)] - displays the name of the transport model (number - idi kara)\n[car_model(number)] - outputs the transport model (number - id of the car)\npickedid(number) - reproduces the use of the pickup (number - id of the pickup)\npickedcoordinate(x,y,z) - reproduces the use of the pickup (x,y,z - coordinates)\n2. Bugs were fixed.",
		"1. Variables/functions were added/removed:\nrelogscript - reloads the script.\nstartbind(number) - the bind starts (number is the number of the bind).\nlistdialogtext(text) - clicks on the dialog sheet if text is found there (text is the text that the variable is looking for).\n{targetname} - removed.\n2. Bugs were fixed.\n3. The working conditions of the bind have been added.",
		'1. New variables/functions have been added:\nchat2(text) - sends a message to the chat via sampSendChat, and not via sampProcessChatInput, as in chat\n{player_nearest} - outputs the number of players in the stream zone\n{car_nearest} - outputs the number of machines in the stream zone\n2. Bugs were fixed.\n3. The section "List of variables" was written. (The list on the forum will be deleted by next Friday, and will not be updated from this Friday)\n4. The stop bind system has been added',
		'1. Functions/variables were divided by types - for binder, and for overlay, or general.Also, to the description of functions/variables, in the section "List of variables/functions", the text was added, for easy search and differences.\n[Binder] - means that this function/variable is for the binder.\n[Overlay] - means that this function/variable is for the overlay.\n[Overlay, Binder] - means that the function/variable works for the binder/overlay.\n2. List of new functions/variables:\n[player_skin_nearest(number)] - outputs the player closest to you with the specified skin (number - skin) [Binder]\n[player_skin_nearest_all(number)] - outputs the number of players in the radius with the skin you selected (number - skin) [Binder]\n[player_color_id(number)] - displays the players color (number - player id) [Overlay]\n[player_color_list(number)] - displays a list of players with color (number - color), up to 50 players [Overlay]\n[idnick(number)] - displays the players nickname by his id (number - player id) [Overlay]\n[online_player(number)] - checks whether the player is online (number - player id) [Overlay]\ncenter - displays text in the center [Overlay]\nseperator - puts a line [Overlay]\n3. Bugs were fixed.\n4. The new version removes the dependency on the library "imgui_piemenu.lua".\n5. The selection selector has been rewritten\n6. A new Overlay system has been added - in which you can edit your overlay, as well as create others.',
		"1. A binder color changing system has been added:\n2. Some bugs were fixed.\n3. The author of the script goes on vacation in honor of summer.",
		"1. New reactions have been added:\n1) Reaction to Textdraw - by id,x and y (position)\n2) Reaction to 3dtext - by text\n2. A new binder mode has been added - Advanced Mode.In it you will be able to write your own lua code.\nwhich means an increase in functionality by a possible maximum.\nNo variables downloadUrlToFile, loadstring, dofile, require - were cut out to increase the security of your accounts.It is also not recommended to download someone else's binds from this update, and put them to yourself.\n3. A cross was made and a reaction to the esc button in the binder menu was made to close it.\n4. Removed the dependency on the vkeys and fAwesome5 libraries.\n5. New variables were added:\n{textdraw_id} - outputs the id of the textdraw on which the reaction was triggered.\n{id_3dtext} - outputs the id of the 3dtext on which the reaction was triggered.\n[textdraw_id_text(number)] - outputs the text of the textdraw by its id (number - id).\n[3dtext_id_text(number)] - outputs 3dtext text by its id (number - id).\n{all_params} - outputs all parameters to the command without separating them.\n6. Bugs were fixed.",
		"1. The translation of the script into the English version has been added.\n2. A dialog system has been added.\nThe dialog system includes variables -\ndialogcreate(title, button1, button2) - creates a dialog (title is the title of the dialog, button1/button2 are dialog buttons).\nlist(text) - creates a sub-item (text is the name of the sub-item).\ndialogclosed - closes the dialog construction.\nExample -\ndialogcreate({FF0000}dialog title, {FF0000}Click, {FF0000}Exit)\nlist({FF0000}List name)\nchatmsg(dialog)\ndialogclosed\n3. Bugs were fixed.",
		"1. Bugs were fixed.",
		"1. Bugs were fixed.\n2. Removed font dependency.",
		'1. Bugs were fixed.\n2. The overlay editing system has been updated:\n3. The "Update" item was updated\nThe update history and the ability to download some old versions of the script were added to it.\n4. Reaction to events \n5 has been added. The logo was updated for the new years style\n6. New functions/variables were added:\nbutton(text,number,text2) [Overlay] - Has 3 types of work.\n1) Without number and text2 - Will simply create a button that, when pressed, will display the name of the button in the chat.\n2) Without text2 - Will activate the bind whose id is specified in number, but will not send the text\n3) Will activate the bind and send the text to the bind \nsameline [Overlay] - transfers the text\n{overlay_text} [Binder] - a variable with which the text is transferred from the button to the overlays.\nswitchoverlay(number) [Binder] - enables/disables overlay (number - overlay id)\nstartoverlay(number) [Binder] - includes overlay (number - id of the overlay)\naddtextoverlay(number,text) [Binder] - adds text to the overlay (number is the overlay id, text is the text to be added)\ndeletetextoverlay(number,text) [Binder] - removes text from overlay (number - overlay id, text - text to be deleted)',
		'1. The color system has been changed. The MoonMonet color system was made.\n2. Added dependency on libraries: MoonMonet, bit.\n3. The selector system has been updated.\n4. Variables for the car have been added to the overlay.\n5. Added new functions/variables:\n{square} [Overlay, Binder] - displays the square you are in\n{zoneru} [Overlay, Binder] - displays the name of the area where you are in Russian\n{zoneeng} [Overlay, Bender] - displays the name of the area in which you are located in English\ndialogwaitopen [Binder] - stops the binder until the dialog is opened/changed\n6. A new event has been added.\n7. Bugs were fixed.\n8. The "Author" section has been updated.\n9. The bind editor has been updated.\n10. Donation system added:\nTo donate, you need to go to the "Author" section\nThen click on the "Donation Alerts" button\nAnd already on the site to which you will be transferred, you will be able to make a donatio',
		"1. Added note system.\n2. Added transparency change system for overlay items.\n3. New activation system for the bind editor has been added.\n4. Added new functions/variables:\n[color_player(number)] [Overlay, Binder] - displays colour of player by his id (number - id)\nswitchbind - enables/disables binds [Binder]\nstartbind2 - enables binds [Binder]\n5. Logo updated.\n6. Bug fixes have been made.",
		'1. Added profile system.\n2. Removed dependency on sampev library and imgui_addons.\n3. Slightly rewritten the system with Hotkey and added the ability to select mouse keys.\n4. Revamped the system of variables, the system of commands and the system with esc.\n5. Revamped the addtextoverlay(text) function.\n6. Added new functions/variables:\nprintstring(text) [Binder] - displays text on the screen\ncopy(text) [Binder] adds text to the clipboard\nswitchoverlayactive [Binder] - activates overlay\n{player_screen_center} [Binder, Overlay] - displays the player in the center of the screen\n7. Were created and added to the section "author" chats in telegram and vk.\n8. Fixed a lot of bugs.',
		'1. Added a system of editing variables from the script itself.\n2. Published a profile for police officers (Arizona RP).\n3. Added new weapons for wagering - UZI and San-off Shotgun.\n4. Added new features/variables:\n{compass} [Overlay, Binder] - displays the side of the world the player is looking at\npicture(filepath,x,y) [Overlay] - draws a picture of the overlay (filepath - path to the file, x - size by x, y - size by ygrik)\n5. Many bugs are fixed.',
		'1. Fixed a bug with some keys not working.',
		'1. Fixed bugs.',
		'1. Fixed bugs.'
	},
