			function loadCodeWithParams(strcode, params)
			local ctx = {}
			setmetatable(ctx, { __index = _G })
			local mt = getmetatable(ctx)
			for k, v in pairs(params) do mt.__index[k] = v end
			local fn = assert(loadstring(strcode))
			setfenv(fn, ctx)
			return fn
			end
			
			function zonereceiving(language)
			x,y,z = getCharCoordinates(PLAYER_PED)
			for i, v in ipairs(streets[language]) do
			if (x >= v[2]) and (y >= v[3]) and (z >= v[4]) and (x <= v[5]) and (y <= v[6]) and (z <= v[7]) then
			return v[1]
			end
			end
			return ''
			end
			
			function isArizonaLauncher()
			if doesFileExist(getGameDirectory()..'\\_CoreGame.asi') or doesFileExist(getGameDirectory()..'\\_ci.asi') then
			return true
			else
			return false
			end
			end
			
			function textupdate(text)
			textupdate = ""
			for i = 3, #text do
			textupdate = textupdate .. u8:decode(text[i]) .. "\n"
			end
			return textupdate
			end
			
			function buttonoverlay(text, namebutton)
			text = u8(text)
			namebutton = u8(namebutton)
			if select(1, string.find(text, "button%(.*%)")) > 1 then
			imgui.Text(string.gsub(string.gsub(text, "button%(" .. text:match("button%((.*)%)") .. "%)", "") .. " ", string.match(string.gsub(text, "button%(" .. text:match("button%((.*)%)") .. "%)", "") .. " ", ".*", select(1, string.find(text, "button%(.*%)"))), "", 1))
			imgui.SameLine()
			end
