			function getClosestCarId()
			local minDist = 9999
			local closestId = -1
			local x, y, z = getCharCoordinates(PLAYER_PED)
			for i = 0, 1800 do
			local streamed, pedID = sampGetCarHandleBySampVehicleId(i)
			if streamed then
			local xi, yi, zi = getCarCoordinates(pedID)
			local dist = math.sqrt( (xi - x) ^ 2 + (yi - y) ^ 2 + (zi - z) ^ 2 )
			if dist < minDist and getDriverOfCar(select(2, sampGetCarHandleBySampVehicleId(i))) ~= PLAYER_PED then
			minDist = dist
			closestId = i
			end
			end
			end
			return closestId
			end
			
