			if getCharModel(select(2, sampGetCharHandleBySampPlayerId(i))) == id then
			number = number + 1
			end
			end
			end
			return number
			end
			
			function getClosestPlayerId(active, id)
			local closestId = -1
			minDist = 30
			local x, y, z = getCharCoordinates(PLAYER_PED)
			for i = 0, 1000 do
			local streamed, pedID = sampGetCharHandleBySampPlayerId(i)
			if streamed and getCharHealth(pedID) > 0 and not sampIsPlayerPaused(pedID) then
			local xi, yi, zi = getCharCoordinates(pedID)
			local dist = getDistanceBetweenCoords3d(x, y, z, xi, yi, zi)
			if active == "simple" then
			if dist <= minDist then
			minDist = dist
			closestId = i
			end
			elseif active == "color" then
			if dist <= minDist and sampGetPlayerColor(select(2, sampGetPlayerIdByCharHandle(PLAYER_PED))) ~= sampGetPlayerColor(i) then
			minDist = dist
			closestId = i
			end
			elseif active == "skin" then
			if dist <= minDist and getCharModel(select(2, sampGetCharHandleBySampPlayerId(i))) == id then
			minDist = dist
			closestId = i
			end
			elseif active == "center" then
			if isCharOnScreen(pedID) and pedID ~= PLAYER_PED then
			if getDistanceBetweenCoords2d(sw / 2, sh / 2, convert3DCoordsToScreen(xi, yi, zi), select(2, convert3DCoordsToScreen(xi, yi, zi))) < 150 and getDistanceBetweenCoords3d(x, y, z, xi, yi, zi) < 50 and not processLineOfSight(x, y, z, xi, yi, zi, true, false, false, true) then
			closestId = i
			end
			end
			end
			end
			end
			return closestId
			end
			
