			imgui.ToggleButton = function(str_id, bool)
			LastActiveTime = {}
			LastActive = {}
			local rBool = false
			
			local function ImSaturate(f)
			return f < 0.0 and 0.0 or (f > 1.0 and 1.0 or f)
			end
			
			local p = imgui.GetCursorScreenPos()
			local draw_list = imgui.GetWindowDrawList()
			
			local height = imgui.GetTextLineHeightWithSpacing() * 1.0
			local width = height * 1.2
			local radius = height * 0.50
			
			if imgui.InvisibleButton(str_id, imgui.ImVec2(width + radius, height)) then
			bool.v = not bool.v
			rBool = true
			LastActiveTime[tostring(str_id)] = os.clock()
			LastActive[tostring(str_id)] = true
			end
			
			local t = bool.v and 1.0 or 0.0
			
			if LastActive[tostring(str_id)] then
			local time = os.clock() - LastActiveTime[tostring(str_id)]
			if time <= 0.13 then
			local t_anim = ImSaturate(time / 0.13)
			t = bool.v and t_anim or 1.0 - t_anim
			else
			LastActive[tostring(str_id)] = false
			end
			end
			
			draw_list:AddRectFilled(imgui.ImVec2(p.x + (radius * 0.65), p.y + (height / 6)), imgui.ImVec2(p.x + (radius * 0.65) + width, p.y + (height - (height / 6))), imgui.GetColorU32(bool.v and imgui.GetStyle().Colors[imgui.Col.FrameBgHovered] or imgui.ImColor(100, 100, 100, 180):GetVec4()), 10.0)
			draw_list:AddCircleFilled(imgui.ImVec2(p.x + (radius * 1.3) + t * (width - (radius * 1.3)), p.y + radius), radius - 1.0, imgui.GetColorU32(bool.v and imgui.GetStyle().Colors[imgui.Col.ButtonActive] or imgui.ImColor(150, 150, 150, 255):GetVec4()))
			
			return rBool
			end
			
