			function json(filePath)
			local f = {}
			
			function f:read()
			local f = io.open(filePath, "r+")
			local jsonInString = f:read("*a")
			f:close()
			local jsonTable = decodeJson(jsonInString)
			return jsonTable
			end
			
			function f:write(t)
			f = io.open(filePath, "w")
			f:write(encodeJson(t))
			f:flush()
			f:close()
			end
			
			return f
			end
			
