			local pDrawList = imgui.GetWindowDrawList()
			pDrawList:PushClipRectFullScreen()
			local oMousePos = imgui.GetIO().MousePos
			local oDragDelta = imgui.ImVec2(oMousePos.x - menuCtx.m_oCenter.x, oMousePos.y - menuCtx.m_oCenter.y)
			local fDragDistSqr = oDragDelta.x*oDragDelta.x + oDragDelta.y*oDragDelta.y
			local fCurrentRadius = menuCtx.c_iRadiusEmpty
			local oArea = {Min = imgui.ImVec2(menuCtx.m_oCenter), Max = imgui.ImVec2(menuCtx.m_oCenter)}
			local bItemHovered = false
			local c_fDefaultRotate = -math.pi / 2
			local fLastRotate = c_fDefaultRotate
			pDrawList:AddCircleFilled(imgui.ImVec2(menuCtx.m_oCenter.x, menuCtx.m_oCenter.y), 30, imgui.GetStyleColorU32(imgui.Col.TitleBg), 25)
			pDrawList:AddText(imgui.ImVec2(menuCtx.m_oCenter.x - imgui.CalcTextSize("[ID: " .. player_select_id .. "]").x / 2, menuCtx.m_oCenter.y - imgui.CalcTextSize("[ID: " .. player_select_id .. "]").y / 2), imgui.GetStyleColorU32(imgui.Col.Text), "[ID: " .. player_select_id .. "]")
			for iIndex = 0, menuCtx.m_iMaxIndex do
			local oPieMenu = menuCtx.m_oPieMenuStack[iIndex]
			local fMenuHeight = math.sqrt(oPieMenu.m_fMaxItemSqrDiameter)
			local fMaxRadius = fCurrentRadius + (fMenuHeight * oPieMenu.m_iCurrentIndex) / 2
			local item_arc_span = 2 * math.pi / math.max(menuCtx.c_iMinItemCount + menuCtx.c_iMinItemCountPerLevel * iIndex, oPieMenu.m_iCurrentIndex)
			local drag_angle = math.atan2(oDragDelta.y, oDragDelta.x)
			local fRotate = fLastRotate - item_arc_span * ( oPieMenu.m_iCurrentIndex - 1 ) / 2
			local item_hovered = -1
			--if oPieMenu.m_iCurrentIndex ~= 1 then
			for item_n = 0, oPieMenu.m_iCurrentIndex - 1 do
			local item_label = oPieMenu.m_oItemNames[ item_n ]
			local inner_spacing = oStyle.ItemInnerSpacing.x / fCurrentRadius / 2
			local fMinInnerSpacing = oStyle.ItemInnerSpacing.x / ( fCurrentRadius * 2 )
			local fMaxInnerSpacing = oStyle.ItemInnerSpacing.x / ( fMaxRadius * 2 )
			local item_inner_ang_min = item_arc_span * ( item_n - 0.5 + fMinInnerSpacing ) + fRotate
			local item_inner_ang_max = item_arc_span * ( item_n + 0.5 - fMinInnerSpacing ) + fRotate
			local item_outer_ang_min = item_arc_span * ( item_n - 0.5 + fMaxInnerSpacing ) + fRotate
			local item_outer_ang_max = item_arc_span * ( item_n + 0.5 - fMaxInnerSpacing ) + fRotate
			local hovered = false
			if fDragDistSqr >= fCurrentRadius * fCurrentRadius and fDragDistSqr < fMaxRadius * fMaxRadius  then
			while (drag_angle - item_inner_ang_min) < 0 do
			drag_angle = drag_angle + (2 * math.pi)
			end
			while (drag_angle - item_inner_ang_min) > 2 * math.pi do
			drag_angle = drag_angle - (2 * math.pi)
			end
			if drag_angle >= item_inner_ang_min and drag_angle < item_inner_ang_max  then
			hovered = true
			bItemHovered = not oPieMenu.m_oItemIsSubMenu[ item_n ]
			end
			end
			-- draw segments
			iColor = imgui.GetStyleColorU32(hovered and imgui.Col.ButtonActive or imgui.Col.TitleBg)
			local arc_segments = math.floor(( 32 * item_arc_span / ( 2 * math.pi ) ) + 1)
			local fAngleStepInner = (item_inner_ang_max - item_inner_ang_min) / arc_segments
			local fAngleStepOuter = ( item_outer_ang_max - item_outer_ang_min ) / arc_segments
			pDrawList:PrimReserve(arc_segments * 6, (arc_segments + 1) * 2)
			for iSeg = 0, arc_segments do
			local fCosInner = math.cos(item_inner_ang_min + fAngleStepInner * iSeg)
			local fSinInner = math.sin(item_inner_ang_min + fAngleStepInner * iSeg)
			local fCosOuter = math.cos(item_outer_ang_min + fAngleStepOuter * iSeg)
			local fSinOuter = math.sin(item_outer_ang_min + fAngleStepOuter * iSeg)
			
			if iSeg < arc_segments then
			local VtxCurrentIdx = pDrawList._VtxCurrentIdx
			pDrawList:PrimWriteIdx(VtxCurrentIdx + 0)
			pDrawList:PrimWriteIdx(VtxCurrentIdx + 2)
			pDrawList:PrimWriteIdx(VtxCurrentIdx + 1)
			pDrawList:PrimWriteIdx(VtxCurrentIdx + 3)
			pDrawList:PrimWriteIdx(VtxCurrentIdx + 2)
			pDrawList:PrimWriteIdx(VtxCurrentIdx + 1)
			end
			pDrawList:PrimWriteVtx(imgui.ImVec2(menuCtx.m_oCenter.x + fCosInner * (fCurrentRadius + oStyle.ItemInnerSpacing.x), menuCtx.m_oCenter.y + fSinInner * (fCurrentRadius + oStyle.ItemInnerSpacing.x)), imgui.ImVec2(0, 0), iColor)
			pDrawList:PrimWriteVtx(imgui.ImVec2(menuCtx.m_oCenter.x + fCosOuter * (fMaxRadius - oStyle.ItemInnerSpacing.x), menuCtx.m_oCenter.y + fSinOuter * (fMaxRadius - oStyle.ItemInnerSpacing.x)), imgui.ImVec2(0, 0), iColor)
			end
			
			local fRadCenter = ( item_arc_span * item_n ) + fRotate
			local oOuterCenter = imgui.ImVec2( menuCtx.m_oCenter.x + math.cos( fRadCenter ) * fMaxRadius, menuCtx.m_oCenter.y + math.sin( fRadCenter ) * fMaxRadius )
			if oPieMenu.m_oItemIsSubMenu[item_n] then
			local oTrianglePos = {imgui.ImVec2(), imgui.ImVec2(), imgui.ImVec2()}
			local fRadLeft = fRadCenter - 5 / fMaxRadius
			local fRadRight = fRadCenter + 5 / fMaxRadius
			oTrianglePos[1].x = menuCtx.m_oCenter.x + math.cos( fRadCenter ) * ( fMaxRadius - 5 )
			oTrianglePos[1].y = menuCtx.m_oCenter.y + math.sin( fRadCenter ) * ( fMaxRadius - 5 )
			oTrianglePos[2].x = menuCtx.m_oCenter.x + math.cos( fRadLeft ) * ( fMaxRadius - 10 )
			oTrianglePos[2].y = menuCtx.m_oCenter.y + math.sin( fRadLeft ) * ( fMaxRadius - 10 )
			oTrianglePos[3].x = menuCtx.m_oCenter.x + math.cos( fRadRight ) * ( fMaxRadius - 10 )
			oTrianglePos[3].y = menuCtx.m_oCenter.y + math.sin( fRadRight ) * ( fMaxRadius - 10 )
			pDrawList:AddTriangleFilled(oTrianglePos[1], oTrianglePos[2], oTrianglePos[3], 0xFFFFFFFF)
			end
			pDrawList:AddText(imgui.ImVec2(menuCtx.m_oCenter.x + math.cos((item_inner_ang_min + item_inner_ang_max) * 0.5) * (fCurrentRadius + fMaxRadius) * 0.5 - imgui.ImVec2(oPieMenu.m_oItemSizes[item_n]).x * 0.5,menuCtx.m_oCenter.y + math.sin((item_inner_ang_min + item_inner_ang_max) * 0.5) * (fCurrentRadius + fMaxRadius) * 0.5 - imgui.ImVec2(oPieMenu.m_oItemSizes[item_n]).y * 0.5), imgui.GetStyleColorU32(imgui.Col.Text), item_label)
			
			if hovered then
			item_hovered = item_n
			end
			end
			oPieMenu.m_fLastMaxItemSqrDiameter = oPieMenu.m_fMaxItemSqrDiameter
			oPieMenu.m_iHoveredItem = item_hovered
			if fDragDistSqr >= fMaxRadius * fMaxRadius then
			item_hovered = oPieMenu.m_iLastHoveredItem
			end
			oPieMenu.m_iLastHoveredItem = item_hovered
			fLastRotate = item_arc_span * oPieMenu.m_iLastHoveredItem + fRotate
			if item_hovered == -1 or not oPieMenu.m_oItemIsSubMenu[item_hovered] then
			break
			end
			--else
			--item_label = oPieMenu.m_oItemNames[1]
			--pDrawList:AddCircle(imgui.ImVec2(menuCtx.m_oCenter.x, menuCtx.m_oCenter.y), 50 + imgui.CalcTextSize(oPieMenu.m_oItemNames[0]).x / 2, imgui.GetStyleColorU32(imgui.Col.TitleBg), 25, 20 + imgui.CalcTextSize(oPieMenu.m_oItemNames[0]).x / 2)
			--print((imgui.CalcTextSize(oPieMenu.m_oItemNames[0]).x + imgui.CalcTextSize(oPieMenu.m_oItemNames[0]).y) / 2)
			--pDrawList:AddText(imgui.ImVec2(menuCtx.m_oCenter.x - imgui.CalcTextSize(oPieMenu.m_oItemNames[0]).x / 2, menuCtx.m_oCenter.y - (50 + imgui.CalcTextSize(oPieMenu.m_oItemNames[0]).y / 2 + imgui.CalcTextSize(oPieMenu.m_oItemNames[0]).x / 2)), imgui.GetStyleColorU32(imgui.Col.Text), oPieMenu.m_oItemNames[0])
			--end
			end
			pDrawList:PopClipRect()
			if oArea.Min.x < 0  then
			menuCtx.m_oCenter.x = ( menuCtx.m_oCenter.x - oArea.Min.x )
			end
			if oArea.Min.y < 0  then
			menuCtx.m_oCenter.y = ( menuCtx.m_oCenter.y - oArea.Min.y )
			end
			local oDisplaySize = imgui.GetIO().DisplaySize
			if oArea.Max.x > oDisplaySize.x then
			menuCtx.m_oCenter.x = ( menuCtx.m_oCenter.x - oArea.Max.x ) + oDisplaySize.x
			end
			if oArea.Max.y > oDisplaySize.y then
			menuCtx.m_oCenter.y = ( menuCtx.m_oCenter.y - oArea.Max.y ) + oDisplaySize.y
			end
			if menuCtx.m_bClose or ( not bItemHovered and imgui.IsMouseReleased( menuCtx.m_iMouseButton ) ) or not activeselector then
			imgui.CloseCurrentPopup()
			end
			imgui.EndPopup()
			imgui.PopStyleColor(2)
			imgui.PopStyleVar(2)
			end
			
			function PieMenuItem(menuCtx, pName)
			assert(menuCtx.m_iCurrentIndex >= 0 and menuCtx.m_iCurrentIndex < menuCtx.c_iMaxPieItemCount)
			local oPieMenu = menuCtx.m_oPieMenuStack[menuCtx.m_iCurrentIndex]
			oPieMenu.m_oItemSizes[oPieMenu.m_iCurrentIndex] = imgui.CalcTextSize(pName, true)
			local fSqrDiameter = imgui.CalcTextSize(pName, true).x * imgui.CalcTextSize(pName, true).x + imgui.CalcTextSize(pName, true).y * imgui.CalcTextSize(pName, true).y
			if fSqrDiameter > oPieMenu.m_fMaxItemSqrDiameter then
			oPieMenu.m_fMaxItemSqrDiameter = fSqrDiameter
			end
			oPieMenu.m_oItemIsSubMenu[oPieMenu.m_iCurrentIndex] = false
			oPieMenu.m_oItemNames[oPieMenu.m_iCurrentIndex] = pName
			local bActive = oPieMenu.m_iCurrentIndex == oPieMenu.m_iHoveredItem
			oPieMenu.m_iCurrentIndex = oPieMenu.m_iCurrentIndex + 1
			if bActive then
			menuCtx.m_bClose = true
			end
			return bActive
			end
			
			menuContext = NewPieMenuContext()
			
			do
			
			local function join_argb(a, r, g, b)
			local argb = b  -- b
			argb = bit.bor(argb, bit.lshift(g, 8))  -- g
			argb = bit.bor(argb, bit.lshift(r, 16)) -- r
			argb = bit.bor(argb, bit.lshift(a, 24)) -- a
			return argb
			end
			
			local function explode_argb(argb)
			local a = bit.band(bit.rshift(argb, 24), 0xFF)
			local r = bit.band(bit.rshift(argb, 16), 0xFF)
			local g = bit.band(bit.rshift(argb, 8), 0xFF)
			local b = bit.band(argb, 0xFF)
			return a, r, g, b
			end
			
			local function ARGBtoRGB(color)
			return bit.band(color, 0xFFFFFF)
			end
			
			function ColorAccentsAdapter(color)
			local a, r, g, b = explode_argb(color)
			
			local ret = {a = a, r = r, g = g, b = b}
			
			function ret:apply_alpha(alpha)
			self.a = alpha
			return self
			end
			
			function ret:as_u32()
			return join_argb(self.a, self.b, self.g, self.r)
			end
			
			function ret:as_vec3()
			return self.r / 255, self.g / 255, self.b / 255
			end
			
			function ret:as_vec4()
			return imgui.ImVec4(self.r / 255, self.g / 255, self.b / 255, self.a / 255)
			end
			
			function ret:as_argb()
			return join_argb(self.a, self.r, self.g, self.b)
			end
			
			function ret:as_rgba()
			return join_argb(self.r, self.g, self.b, self.a)
			end
			
			function ret:as_chat()
			return string.format("%06X", ARGBtoRGB(join_argb(self.a, self.r, self.g, self.b)))
			end
			
			return ret
			end
			end
			
			function color_argb(color2)
			color = color2[3] * 255
			color = bit.bor(color, bit.lshift(color2[2] * 255, 8))
			color = bit.bor(color, bit.lshift(color2[1] * 255, 16))
			color = bit.bor(color, bit.lshift(0, 24))
			color =  "0xff" .. ('%06X'):format(color)
			return color2[4], color
			end
			
